import './App.css';
import {useEffect, useState} from "react";

function App() {
  const [users, setUsers] = useState([]);

  async function fetchUsers () {
    const res = await fetch('https://jsonplaceholder.typicode.com/users');
    const usersData = await res.json();

    setUsers(usersData);


  }

  useEffect(() => {
    fetchUsers();
  }, [])

  return (
    <ul>
      {users.map(user => {
        return (
            <li>
              {user.name}
            </li>
        )
      })}
    </ul>
  );
}

export default App;
